import { MdDelete } from "react-icons/md";



const CartItem = ({item}) => {
  return (
    <div>
      <div>
        <img src={item.image}></img>
      </div>
      <div>
        <p>{item.title}</p>
        <p>{item.description}</p>
        
        <div>
          <p>{item.price}</p>
          <div className="bg-red-700">
            <p><MdDelete /></p>
          </div>
        </div>

      </div>
    </div>
  );
};

export default CartItem;
